import './FaceRecognition.css'

const FaceRecognition = ({ imageUrl, box }) => {
    return (
        <div className="center pa4 ma">
            <div className="absolute mt2 shadow-5">
                <img
                    alt=""
                    src={imageUrl}
                    width="500px"
                    height="auto"
                    id="inputimage"
                />
                <>
                    box ? (
                    box.map((item) => (
                    <div
                        key={item.bottomRow}
                        className='bounding-box'
                        style={{
                            top: item.topRow,
                            right: item.rightCol,
                            bottom: item.bottomRow,
                            left: item.leftCol,
                        }}
                    ></div>
                    ))
                    ) : (
                    <div
                    >
                    </div>
                    )
                </>

            </div>
        </div>
    )
}

export default FaceRecognition;
